import * as S from "./style";
const Header = () => {
  const Titles: Array<string> = ["IMAGE", "VIDEO", "NOTE", "TASK"];
  return (
    <S.HeaderWrapper>
      <div style={{ fontSize: "1.8rem" }}>MOTION</div>
      <S.FlexContainer>
        {Titles.map((title) => {
          return <S.Button>{title}</S.Button>;
        })}
      </S.FlexContainer>
    </S.HeaderWrapper>
  );
};
export default Header;
